"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Tardive dyskinesia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/tardive-dyskinesia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H2368302505\">",
"      <span class=\"h1\">",
"       What is tardive dyskinesia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Tardive dyskinesia is a disorder that causes you to make strange movements. It can make you move your mouth, tongue, face, trunk, arms, or legs in weird ways, even when you are not trying to move. This disorder is a side effect of taking certain medicines. It most often happens in people who have been taking medicines called antipsychotics, which are used to treat mental illness, such as schizophrenia. Sometimes the disorder becomes permanent.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302520\">",
"      <span class=\"h1\">",
"       What are the symptoms of tardive dyskinesia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with tardive dyskinesia make strange movements that they can&rsquo;t control.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        They sometimes:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Make odd faces",
"       </li>",
"       <li>",
"        Stick out their tongue or move their tongue around",
"       </li>",
"       <li>",
"        Pout, pucker, or smack their lips",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        They might twist or spread their fingers over and over again, or move them as though they are playing a piano.",
"       </li>",
"       <li>",
"        Their legs might make quick, jerking movements, or slow, writhing movements.",
"       </li>",
"       <li>",
"        Their neck might twist at strange angles, or their hips might thrust.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302535\">",
"      <span class=\"h1\">",
"       What causes tardive dyskinesia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Tardive dyskinesia is a side effect of being on certain medicines for a while. Often it starts when the dose of the medicine is lowered, or when the medicine is stopped. The main medicines that cause it include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines called antipsychotics, such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?36/63/37877?source=see_link\">",
"         Haloperidol",
"        </a>",
"        (brand name: Haldol&reg;)",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?26/6/26725?source=see_link\">",
"         Fluphenazine",
"        </a>",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?21/27/21942?source=see_link\">",
"         Risperidone",
"        </a>",
"        (brand name: RisperDAL&reg;)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?33/45/34517?source=see_link\">",
"         Metoclopramide",
"        </a>",
"        (brand name: Reglan&reg;), which is used to control nausea and vomiting and to treat acid reflux. No one should take this medicine for longer than 3 months. There are other medicines that can be used in its place.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302550\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably not. If you have been on an antipsychotic medicine for at least a month and you show signs of tardive dyskinesia, the doctor or nurse will probably be able to tell what&rsquo;s wrong. Still, it&rsquo;s possible the doctor or nurse will order blood tests or brain scans to make sure your symptoms are not caused by another problem.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302565\">",
"      <span class=\"h1\">",
"       How is tardive dyskinesia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The treatment usually involves switching antipsychotic medicines or changing the dose. In some cases, the condition will go away or improve a little if the medicine that caused it is stopped. Unfortunately, it is not always possible to stop the medicine.",
"     </p>",
"     <p>",
"      There are also medicines that can be given along with antipsychotic medicines that seem to help with tardive dyskinesia. For example, medicines called benzodiazepines can ease tardive dyskinesia symptoms in people who also have anxiety. If your doctor is not able to control your tardive dyskinesia by switching your antipsychotic medicine or changing your dose, he or she might suggest adding other medicines.",
"     </p>",
"     <p>",
"      People who have abnormal movement only in certain body parts (such as the eyelids) can get injections of a medicine called botulinum toxin. Botulinum toxin, also called BoTox&reg;, can help muscles relax and stop moving abnormally.",
"     </p>",
"     <p>",
"      People with severe tardive dyskinesia that does not improve with other treatment options can sometimes get a treatment called &ldquo;deep brain stimulation&rdquo; (also called &ldquo;DBS&rdquo;). People who get DBS must first have surgery to place wires into a part of the brain that helps control muscle movement. The wires are attached to a device that gets implanted under the skin, usually near the collarbone. It sends electrical signals to the brain to reduce abnormal movement.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302580\">",
"      <span class=\"h1\">",
"       Can tardive dyskinesia be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes and no. Tardive dyskinesia is an unfortunate side effect of medicines that people need to take to be well. Most people who take these medications do not get tardive dyskinesia, but some do. It&rsquo;s not always possible to avoid these medicines, so it&rsquo;s not always possible to avoid tardive dyskinesia. Still, there are certain things you can do to reduce the chances of getting the disorder or having a severe form of it. If you are on an antipsychotic medicine, watch out for abnormal movements and let your doctor know right away if you notice any. The earlier the symptoms of tardive dyskinesia are found, the more likely it is that something can be done to prevent the condition from becoming permanent.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302595\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?0/30/483?source=see_link\">",
"       Patient information: Dealing with side effects from medicines (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?31/34/32290?source=see_link\">",
"       Patient information: Taking medicines when you're older (The Basics)",
"      </a>",
"     </p>",
