" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Antibodies to double-stranded (ds)DNA, Sm, and U1 RNP",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?1/10/1192/contributors\">",
