var title_f1_10_1196="Periop hemostasis agents";
var content_f1_10_1196=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F68515&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F68515&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Perioperative management of agents affecting hemostasis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Name or class of drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical considerations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended strategy for surgery with brief NPO state",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended strategy for surgery with prolonged NPO state",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Aspirin and dipyridamole",
"       </td>",
"       <td>",
"        <p>",
"         Continuation may cause perioperative hemorrhage.",
"        </p>",
"        <p>",
"         Discontinuation may increase the risk of vascular complications.",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Continue for surgeries where patients are at high risk for perioperative vascular complications and morbidity related to perioperative hemorrhage is not significant.",
"        </p>",
"        <p>",
"         Discontinue for surgeries where perioperative bleeding could be catastrophic as in CNS surgery. If decision is made to stop, discontinue aspirin 7 to 10 days before surgery and discontinue dipyridamole at least&nbsp;two days before surgery.",
"        </p>",
"       </td>",
"       <td>",
"        Resume with oral intake.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        P2Y12 receptor blockers(clopidogrel, prasugrel, ticlopidine, ticagrelor)",
"       </td>",
"       <td>",
"        When used after cardiac stenting procedure, if discontinued can cause cardiac ischemia perioperatively. If continued can result in bleeding complications.",
"       </td>",
"       <td>",
"        Ideally elective procedures should be delayed until the mandatory period of platelet inhibition with these agents is completed. When used for long-term stroke prophylaxis, should be discontinued 7 to 10 days.",
"       </td>",
"       <td>",
"        Resume with oral intake.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Warfarin",
"       </td>",
"       <td colspan=\"3\">",
"        See \"Management of anticoagulation before and after elective surgery\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dabigatran",
"       </td>",
"       <td colspan=\"3\">",
"        See \"Management of anticoagulation before and after elective surgery\"",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
